webpackJsonp([0xdec3770e6f93],{7348:function(e,t){e.exports={data:{post:{html:'<p><a href="http://www.nytimes.com/2005/06/09/sports/baseball/09cubs.html?8hpib" title="Red Sox Arrive to Remind Cubs Who\'s Left Holding Curse Now - New York Times">Red Sox play in Wrigley Field for first time since 1918</a><br />\n<blockquote> In the middle of the sixth inning Tuesday night... the (black) cat bolted from its underground quarters, crossed in front of the Cubs\' dugout and leapt into the third-base box seats before security guards could corral it... Cubs Manager Dusty Baker discounted the significance of the appearance of the black cat Tuesday night because it had white paws...</p></blockquote>\n<p>This is almost as weird as current German politics. Maybe Schr&ouml;der should start releasing black cats from the Kanzleramt.</p>',fields:{title:"Why Not Us?",date:"09 Jun 2005",url:"https://papascott.de/2005-06-09-why-not-us/"}}},pathContext:{slug:"/2005-06-09-why-not-us/",prev:{fields:{title:"Where the US comes up short",date:"09 Jun 2005",slug:"/2005-06-09-where-the-us-comes-up-short/"}},next:{fields:{title:"'Grandpa Gang' bank robbers jailed",date:"10 Jun 2005",slug:"/2005-06-10--grandpa-gang-bank-robbers-jailed/"}}}}}});
